import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import { Navigation, Autoplay } from 'swiper/modules';

export default function Dashboard() {
  const navigate = useNavigate();

  const groupedServices = {
    'üõ¨ Essential Services': [
      'Airport Pickup', 'Housing Help', 'Job Board', 'SIN & ID Setup', 'Legal Help',
      'Health Services', 'Banking Advice', 'Emergency Contacts', 'Driving License',
      'Childcare Info', 'Postal & Shipping', 'Household Setup'
    ],
    'üåè Community & Lifestyle': [
      'Nepali Stores', 'Community', 'Language Prep', 'Mental Wellness', 'Grocery List',
      'Religious Centers', 'Travel & Outdoors', 'Events Calendar', 'Annoucements/Events'
    ],
    'üìö Learning & Development': [
      'Student Support', 'Scholarship Guide', 'Skill Training', 'Digital Literacy',
      'Youth Programs', 'Cooking Classes', 'Tax Filing Help'
    ]
  };

  const iconMap = {
    'Airport Pickup': '‚úàÔ∏è', 'Housing Help': 'üè†', 'Job Board': 'üíº',
    'SIN & ID Setup': 'üÜî', 'Legal Help': 'üìÑ', 'Health Services': 'üë®‚Äç‚öïÔ∏è',
    'Banking Advice': 'üè¶', 'Emergency Contacts': 'üìû', 'Driving License': 'üöó',
    'Childcare Info': 'üçº', 'Postal & Shipping': 'üì¨', 'Household Setup': 'üßº',
    'Nepali Stores': 'üõçÔ∏è', 'Community': 'ü§ù', 'Language Prep': 'üó£Ô∏è',
    'Mental Wellness': 'üßò‚Äç‚ôÇÔ∏è', 'Grocery List': 'üõí', 'Religious Centers': 'üïå',
    'Travel & Outdoors': 'üèïÔ∏è', 'Events Calendar': 'üìÖ', 'Annoucements/Events': 'üì¢',
    'Student Support': 'üìö', 'Scholarship Guide': 'üéì', 'Skill Training': 'üßë‚Äçüè´',
    'Digital Literacy': 'üíª', 'Youth Programs': 'üéÆ', 'Cooking Classes': 'üßë‚Äçüç≥',
    'Tax Filing Help': 'üßæ'
  };

  return (
    <div className="bg-gray-50 min-h-screen font-sans">
      {/* Top bar */}
      <div className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
        <h1 className="text-2xl font-bold text-blue-700">ConnectingNepali</h1>
        <button
          onClick={() => {
            localStorage.clear();
            navigate('/');
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      {/* Welcome Section */}
      <div className="bg-blue-100 text-center py-10 px-6">
        <h2 className="text-3xl font-bold text-gray-800 mb-2">Welcome, Nepali Immigrants!</h2>
        <p className="text-gray-700 text-lg">Explore essential services, support, and opportunities across Canada.</p>
      </div>

      {/* Promo Slider Section */}
      <div className="bg-emerald-900 text-white rounded-2xl my-10 mx-6 p-6 md:flex items-center justify-between shadow-lg overflow-hidden">
        <div className="flex-1 mr-6">
          <h2 className="text-3xl font-bold mb-2">Announcements/Events</h2>
          <p className="mb-4 text-white/90">See the tick, know it's backed by Authenticity Guarantee.</p>
          <button className="bg-white text-emerald-900 px-5 py-2 rounded-full hover:bg-gray-100">Browse now</button>
        </div>

        <div className="flex-1 max-w-md">
          <Swiper
            spaceBetween={20}
            slidesPerView={1}
            autoplay={{ delay: 3000 }}
            navigation
            modules={[Navigation, Autoplay]}
            loop
          >
            {['shoe1.png', 'shoe2.png', 'shoe3.png'].map((img, index) => (
              <SwiperSlide key={index}>
                <div className="bg-white p-3 rounded-xl flex justify-center items-center h-48 shadow-md">
                  <img
                    src={`/images/${img}`}
                    alt={`Slide ${index + 1}`}
                    className="object-contain h-full w-auto"
                  />
                </div>
              </SwiperSlide>
            ))}
          </Swiper>
        </div>
      </div>

      {/* Grouped Our Services Section */}
      <div className="px-6 py-10 bg-white">
        {Object.entries(groupedServices).map(([groupTitle, items]) => (
          <div key={groupTitle} className="mb-10">
            <h2 className="text-xl font-bold text-gray-800 mb-4">{groupTitle}</h2>
            <div className="flex space-x-4 overflow-x-auto no-scrollbar pb-2">
              {items.map((title, i) => (
                <div
                  key={i}
                  className="flex-shrink-0 w-36 bg-gray-50 rounded-xl shadow p-4 flex flex-col items-center justify-center text-center hover:shadow-md transition"
                >
                  <div className="text-3xl mb-2">{iconMap[title]}</div>
                  <h4 className="text-sm font-semibold text-gray-700">{title}</h4>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
